const IDs = [
    'system.adapter.admin.0.memHeapTotal',
    'system.adapter.admin.0.memRss',
];

// create mqtt state
createState('mqtt.0.event', {name: 'MQTT event', type: 'string'}, function () {
    // subscribe on all changes
    IDs.forEach(id => 
        on(id, obj => {
            // set event in desired state
            setState('mqtt.0.event', JSON.stringify({
                id: obj.id, 
                val: obj.state.val
            }));
        }));
});
